和平, $B$ (底面积) = 30 square inches, $h$ (高度) = 6.5 inches.

我们想要找到$V$ (体积)。

将给定的值代入体积公式：

\[
V = \frac{1}{3} \times B \times h
\]

\[
V = \frac{1}{3} \times 30 \times 6.5
\]

首先，计算$30 \times 6.5$：

\[
30 \times 6.5 = 195
\]

现在，将195除以3：

\[
V = \frac{1}{3} \times 195 = 65
\]

因此，体积是：

\[
\boxed{65}
\] cubic inches。 

